import React from "react";

export default Other = () => {
    return(
        <div className="other--list">
            <ul>
                <li>Regulations</li>
                <li>More</li>
                <li>About us</li>
                <li>Work with us</li>
                <li>Find your dream job</li>
                <li>Visit our place</li>
            </ul>
        </div>
    )
}
